import React from 'react';
import background from './background.jpg'

function HomePage() {
  return (
    <div>
    <header style={{backgroundImage: `url(${background})`, textAlign: 'center', padding: '50px 0', backgroundSize: 'cover', backgroundPosition: 'center', position: 'relative'}}>
      <div style={{position: 'absolute', top: '50%', left: '50%', transform: 'translate(-50%, -50%)', color: '#fff'}}>
        <img src={background} alt="background" style={{width: '100%', height: 'auto', opacity: 0}} />
        <h1>保护地球人人有责</h1>
      </div>
    </header>
  </div>
  );
}

export default HomePage;
